ISLAMABAD, Dec 30 (APP): The Senate on Wednesday offered Fateha for departed souls of later Senator Kalsoom Parveen and former prime minister Mir Zafarulllah Jamali.
Maulana Abdul Ghafoor Haideri led the Fateha on request of Chairman Senate Muhammad Sadiq Sanjrani.
